import React from 'react';
import './app.css';
import SignUp from './components/SignUp';
import {BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import SignIn from './components/SignIn';

// 1. route를 이용해서 경로 설정
// 2. exact -> 정확한 루트


function App() {
  return (
     <Router>
      <Switch>
        <Route  path="/">
          <SignIn />   
        </Route>

  <Route exact={true} path ="/SignUp">
      <SignUp />    
    </Route>
    </Switch>
     </Router>

  )
}

export default App;



